import React, { Component } from 'react'
import { AboutCon, About_img, About_text1, About_text2 } from "./About.js"
import About_img1 from '../../Assets/aboutimg.png'
export default class About extends Component {
    render() {
        return (
            <AboutCon>
                <About_img src={About_img1} />
                <About_text1>About Us </About_text1>
                <About_text2> </About_text2>
            </AboutCon>
        )
    }
}
